import React from 'react';
import Card from 'react-bootstrap/Card';
import {FontAwesomeIcon} from '@fortawesome/react-fontawesome';
import {faCoffee} from '@fortawesome/free-solid-svg-icons';
import {CardGroup} from 'react-bootstrap';
import {FaPaypal, FaPatreon, FaShoppingBag, IoLogoVenmo} from 'react-icons/all';


const fontStyles = {fontSize: "80px"}; 
function CardMoney() {
  return ( 
  <CardGroup className="m-auto">
    <Card bg="yellow" style={{width: '18rem'}} >
      <Card.Body >
        <Card.Title> Paypal </Card.Title> 
        <Card.Text > <FaPaypal style={fontStyles}/></Card.Text> 
      </Card.Body> 
    </Card> 
    <Card style={{width: '18rem'}} >
      <Card.Body >
        <Card.Title > Venmo </Card.Title> 
        <Card.Text ><IoLogoVenmo style={{fontSize: "90px"}}/> </Card.Text> 
      </Card.Body> 
    </Card> 
    <Card style = {{width: '18rem'}} >
      <Card.Body >
        <Card.Title > Patreon </Card.Title> 
        <Card.Text ><FaPatreon/> </Card.Text> 
      </Card.Body> 
    </Card> 
    <Card style = {{width: '18rem'}}>
      <Card.Body >
        <Card.Title > Our Shop </Card.Title> 
        <Card.Text ><FaShoppingBag/></Card.Text> 
      </Card.Body>
    </Card>
  </CardGroup>
  )
}

export default CardMoney;
